import {
    Card,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Button,
    CardImg,
} from "reactstrap";

const ProjectCard=()=>{
    return (
    <Card>
        <CardImg
      alt="Card image cap"
      src="https://picsum.photos/256/186"
      top
      style={
          {
              width:"50%",
              height:"50%",
          }
      }
    />


    <CardBody>
      <CardTitle tag="h5">
        Card title
      </CardTitle>
      <CardSubtitle
        className="mb-2 text-muted"
        tag="h6"
      >
        Card subtitle
      </CardSubtitle>
      <CardText>
        Some quick example text to build on the card title and make up the bulk of the card's content.
      </CardText>
      <Button>
        Button
      </Button>
    </CardBody>
  </Card>
    );
};


export default ProjectCard;
